import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import Divider from '@mui/material/Divider';
import Drawer from '@mui/material/Drawer';
import IconButton from '@mui/material/IconButton';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import MenuIcon from '@mui/icons-material/Menu';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import { Link } from 'react-router-dom';
import { Grid } from '@mui/material';
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';
import TwitterIcon from '@mui/icons-material/Twitter';
import Tooltip from '@mui/material/Tooltip';
import MailIcon from '@mui/icons-material/Mail';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import * as AdminHelper from '../util/AdminUtil';

const Navbar = (props) => {

    const fontSize = ".9em";
    const iconStyle = {
        fontSize: 15, 
        marginRight: '3px'
    };

    const shopOptions = ['Coffee', 'Subscription', 'Cold Brew', 'Merchandise', 'Coffee Box Sets', 'Gifts', 'Gift Cards', 'Tea', 'Sales & Bundles', 'Mobile App & Rewards' ]

    const { window } = props;
    const [mobileOpen, setMobileOpen] = React.useState(false);

    const drawerWidth = props.drawerWidth;
    const navItems = ['home', 'about', 'sandbox']

    const handleDrawerToggle = () => {
        setMobileOpen((prevState) => !prevState);
    };

    const [anchorEl, setAnchorEl] = React.useState(null);
    const open = Boolean(anchorEl);

    const handleMenuDropDownClick = (event) => {
      setAnchorEl(event.currentTarget);
    };
    const handleMenuDropDownClose = () => {
      setAnchorEl(null);
    };


    // drawer is what you see on mobile
    const drawer = (
        <Box onClick={handleDrawerToggle} sx={{ textAlign: 'center' }}>
            <Typography variant="h6" sx={{ my: 2 }}>
                Little Creek Coffee
            </Typography>
            <Divider />
            <List>
                {navItems.map((item) => (
                <ListItem key={item} disablePadding>
                    <ListItemButton sx={{ textAlign: 'center' }}>
                        <ListItemText>
                            <Link to={`/${item}`} style={{ textDecoration: 'none', color: '#000' }} > 
                                {item}
                            </Link>
                        </ListItemText>
                    </ListItemButton>
                </ListItem>
                ))}
            </List>
        </Box>
    );

    const container = window !== undefined ? () => window().document.body : undefined;

    return (
    <Box sx={{ display: 'flex' }}>
        <CssBaseline />
        <AppBar component="nav" elevation={0}>

        {/* Fixed top nav for bigger screen */}
        <AppBar position="static" sx={{ height: '25px' }} color="secondary" elevation={0}>
            <Grid display={{ md: "block", sm: "none", xs: "none" }}>
                <Grid item xs={12} sx={{ marginTop:"2px", alignItems:"center", justifyContent:"center", display: 'flex'}}>
                    <Typography mr={1} fontSize={fontSize} >
                        Get The App |
                    </Typography>
                    <Typography mr={1} fontSize={fontSize} >
                        Brewing Change |
                    </Typography>
                    <Typography mr={1} fontSize={fontSize} >
                        Join Our Team |
                    </Typography>
                    <Typography mr={1} fontSize={fontSize} >
                        Wholesale Login |
                    </Typography>
                    <Typography mr={1} fontSize={fontSize} >
                        Contact Us |
                    </Typography>
                    <MailIcon sx={iconStyle} /> 
                    <Typography mr={1} fontSize={fontSize} >
                        Coffee Geek Reports
                    </Typography>
                    <Tooltip title="Follow on Facebook" arrow>  
                        <FacebookIcon sx={iconStyle} />
                    </Tooltip>
                    <Tooltip title="Follow on Instagram" arrow>  
                        <InstagramIcon sx={iconStyle} />
                    </Tooltip>
                    <Tooltip title="Follow on Twitter" arrow>  
                        <TwitterIcon sx={iconStyle} />
                    </Tooltip>
                    <Tooltip title="Send us an email - TODO" arrow>  
                        <MailIcon sx={iconStyle} />
                    </Tooltip>  
                </Grid>
            </Grid>
        </AppBar>

        {/* Big screen display */}
        <Toolbar>
            <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            onClick={handleDrawerToggle}
            sx={{ mr: 2, display: { sm: 'none' } }}
            >
            <MenuIcon />
            </IconButton>

            <Typography
            variant="h6"
            component="div"
            sx={{ flexGrow: 1, display: { xs: 'none', sm: 'block' } }}
            >
            Little Creek CoffeeSSS
            </Typography>
            
            {/* <Box sx={{ display: { xs: 'none', sm: 'block' } }}>
            {navItems.map((item) => (
                <Button key={item} >
                <Link to={`/${item}`} style={{ textDecoration: 'none', color: '#fff' }} >
                    {item}
                </Link>
                </Button>
            ))}
            </Box> */}

            <Box sx={{ display: { xs: 'none', sm: 'block' } }}>

            {/* Shop Dropdown */}
            <Button
            id="fade-button"
            aria-controls={open ? 'fade-menu' : undefined}
            aria-haspopup="true"
            aria-expanded={open ? 'true' : undefined}
            onClick={handleMenuDropDownClick}
            sx = {{color: '#fff' }}
            endIcon={<KeyboardArrowDownIcon />}
            >
                Shop
            </Button>
            <Menu
            id="fade-menu"
            MenuListProps={{
            'aria-labelledby': 'fade-button',
            }}
            anchorEl={anchorEl}
            open={open}
            onClose={handleMenuDropDownClose}
            >
            {shopOptions.map(option => {
                let url = AdminHelper.slugify(option);
                url = url === 'sales-&-bundles' ? 'sales' : url;
                url = url == 'mobile-app-&-rewards' ? 'mobile-ordering' : url;
                return <ListItemButton component={Link} to={`/product-category/${url}`} key={option}>
                            <ListItemText primary={option} />
                        </ListItemButton>
                  
            })}
            </Menu>

            {/* Cafes Dropdown */}
            <Button
            id="fade-button"
            aria-controls={open ? 'fade-menu' : undefined}
            aria-haspopup="true"
            aria-expanded={open ? 'true' : undefined}
            onClick={handleMenuDropDownClick}
            sx = {{color: '#fff' }}
            endIcon={<KeyboardArrowDownIcon />}
            >
                Cafes
            </Button>
            <Menu
            id="fade-menu"
            MenuListProps={{
            'aria-labelledby': 'fade-button',
            }}
            anchorEl={anchorEl}
            open={open}
            onClose={handleMenuDropDownClose}
            >
            {shopOptions.map(option => {
                let url = AdminHelper.slugify(option);
                url = url === 'sales-&-bundles' ? 'sales' : url;
                url = url == 'mobile-app-&-rewards' ? 'mobile-ordering' : url;
                return <ListItemButton component={Link} to={`/product-category/${url}`} key={option}>
                            <ListItemText primary={option} />
                        </ListItemButton>
            })}
            </Menu>
      
            </Box>




        </Toolbar>
        </AppBar>
        <Box component="nav">
        <Drawer
            container={container}
            variant="temporary"
            open={mobileOpen}
            onClose={handleDrawerToggle}
            ModalProps={{
            keepMounted: true, // Better open performance on mobile.
            }}
            sx={{
            display: { xs: 'block', sm: 'none' },
            '& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth },
            }}
        >
            {drawer}
        </Drawer>
        </Box>
    </Box>
    );
}

export default Navbar;
